// PropertyDetail.jsx
import React from 'react';
import { useParams } from 'react-router-dom';

export const PropertyDetail = (props) => {
  const { id } = useParams();
  
  // In a real application, you would fetch property details using the id.
  // Here, I'll provide dummy data for demonstration purposes.
  const propertyDetails = {
    1: { title: 'Property 1', description: 'Details about Property 1', image: 'img/01-large.jpg' },
    2: { title: 'Property 2', description: 'Details about Property 2', image: 'img/02-large.jpg' },
    3: { title: 'Property 3', description: 'Details about Property 3', image: 'img/03-large.jpg' },
    4: { title: 'Property 4', description: 'Details about Property 4', image: 'img/04-large.jpg' },
    5: { title: 'Property 5', description: 'Details about Property 5', image: 'img/05-large.jpg' },
    6: { title: 'Property 6', description: 'Details about Property 6', image: '06-large.jpg' },
  };

  const property = propertyDetails[id];

  if (!property) {
    return <div>Property not found.</div>;
  }

  return (
    <div>
      <h1>{property.title}</h1>
      <img src={property.image} alt={property.title} />
      <p>{property.description}</p>
    </div>
  );
};

export default PropertyDetail;
